import React from 'react';
import Header from '../components/Header';

const AboutPage = () => {
  return (
    <div>
      <Header />
      <h1>About Us</h1>
      <p>Hotel XYZ is a luxury hotel offering premium services to its guests.</p>
    </div>
  );
};

export default AboutPage;
